A ruthless vampire stalks the streets of Las Vegas searching for a rare but perfect blood type that will enable him and his fellow vampires to walk in daylight.

In Las Vegas, the powerful three hundred year old vampire Sylvian hires Dr. van Helm to research a cure to survive in the sun...
